import React from 'react';
import Card from "./Card";


function App(){
    return(
        <>
    <Card imgscr="https://via.placeholder.com/150" 
    title="Awesome Series 1" 
    sname="Dark" 
    link="https://placeholder.com"/>
    
    <Card imgscr="https://via.placeholder.com/150" 
    title="Awesome Series 2" 
    sname="light" 
    link="https://placeholder.com"/>
    
    <Card imgscr="https://via.placeholder.com/150" 
    title="Awesome Series 3" 
    sname="lighter" 
    link="https://placeholder.com"/>
    </>
    );

}
export default App;
